import React, { useState } from 'react';
import axios from 'axios';

function Signup() {
  const handleSubmit = async (event) => {
    event.preventDefault();
    
    const formData = {
      name: event.target.name.value,
      mobile: event.target.mobile.value,
      email: event.target.email.value,
      dob: event.target.dob.value,
      gender: event.target.gender.value,
      address: event.target.address.value
    };
  
    try {
      const response = await axios.post('http://localhost:8000/api/signup/', formData);
      console.log('Signup successful', response.data);
    } catch (error) {
      console.error('Error during signup:', error.response?.data || error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="name" value={formData.name} onChange={handleChange} placeholder="Name" />
      <input type="text" name="mobile" value={formData.mobile} onChange={handleChange} placeholder="Mobile" />
      <input type="email" name="email" value={formData.email} onChange={handleChange} placeholder="Email" />
      <input type="date" name="dob" value={formData.dob} onChange={handleChange} placeholder="Date of Birth" />
      <select name="gender" value={formData.gender} onChange={handleChange}>
        <option value="">Select Gender</option>
        <option value="Male">Male</option>
        <option value="Female">Female</option>
      </select>
      <textarea name="address" value={formData.address} onChange={handleChange} placeholder="Address" />
      <button type="submit">Sign Up</button>
    </form>
  );
}

export default Signup;
